            ans_counter = 0
            for ans in reply.split('\n'):
                index_from = ans.find('[')
                index_to = ans.find(']')
                list_str = ans[index_from: index_to + 1]
                correct_answer = answer_list[ans_counter]
                try:
                    user_list = ast.literal_eval(list_str)
                except Exception:
                    return CheckResult.wrong(f"Seems that output is in wrong format.\n"
                                             f"Make sure you use only the following Python structures in the output: string, int, float, list, dictionary.")

                if not isinstance(user_list, list):
                    return CheckResult.wrong(f'Print {ans_counter + 1} answer as a list')

                if len(user_list) != len(correct_answer):
                    return CheckResult.wrong(f'Output {ans_counter + 1} should contain {len(correct_answer)} values, found {len(user_list)}')

                for i in range(len(user_list)):
                    if user_list[i] != correct_answer[i]:
                        return CheckResult.wrong(f"Seems like answer is not correct\n"
                                                 f"Check element {i} of your {ans_counter + 1} list")

                ans_counter += 1
            return CheckResult.correct()


